var AgeGateView = Backbone.View.extend({
    
    MIN_AGE: 17, 
    COOKIE_NAME: 'agegate_validate_fail', 
    COOKIE_EXPIRATION: 24, // hours
    
    initialize: function(){
        _.bindAll(this);
        
        this.$content = $('.content', this.$el);
        this.$placeholder = $('.placeholder', this.$el);
        this.$placeholder.click(this.show);
    },
    
    show: function(){
        var $body = $('body');
        this.$modal = $($('#tpl_agegate').html()).hide();
        $body.append(this.$modal);
        
        this.$overlay = $('<div/>', {'class':'modal-overlay'}).hide();
        $body.append(this.$overlay);
        
        this.$submit = $('.submit', this.$modal);
        this.$submit.click(this.validate);
        
        this.screenUtilsModel.on('windowUpdated', this.position);
        this.scroll_listener = $(document).on('scroll', this.position);
        
        if(!this.isMobile()){
            $(".day", this.$modal).selectbox('attach');
            $(".month", this.$modal).selectbox('attach');
            $(".year", this.$modal).selectbox('attach');
        }
        
        this.position();
        this.$modal.show();
        this.$overlay.show();
        
        if(Cookie.get(this.COOKIE_NAME))
            this.failure();
    }, 
    
    failure: function(){
        $('.first', this.$modal).hide();
        $('.failure', this.$modal).show();
        $('.dismiss', this.$modal).click(this.dismiss);
        this.position();
    }, 
    
    success: function(){
        // Allow override for other uses. 
        if(this.options.success)
            return this.options.success(this);
        
        this.dismiss();
        this.$placeholder.hide();
        this.$content.show();
    }, 
    
    dismiss: function(e){
        if(e) e.preventDefault();
        this.$modal.fadeOut('fast', function(){ $(this).remove() });
        this.$overlay.fadeOut('fast', function(){ $(this).remove() });
        this.scroll_listener.unbind();
    }, 
    
    validate: function(e){
        if(e) e.preventDefault();
        var month = this._get_select_value($('.month', this.$modal)), 
            day = this._get_select_value($('.day', this.$modal)), 
            year = this._get_select_value($('.year', this.$modal)), 
            today = new Date(), 
            birthdate = new Date(year, month - 1, day), 
            minumum_date = new Date(today.getFullYear() - this.MIN_AGE, 
                today.getMonth(), today.getDay());
        
        if(birthdate.getTime() > minumum_date.getTime()){
            Cookie.set(this.COOKIE_NAME, true, this.COOKIE_EXPIRATION);
            this.failure();
        } else {
            this.success();
        }
    }, 
    
    position: function(){
        var $body = $('body'), 
            $window = $(window);
        
        this.$modal.css('top', (this.isMobile()? 45 : 180) + $window.scrollTop());
        this.$modal.css('left', ($body.width() - this.$modal.width()) / 2);
        this.$overlay.css('top', $window.scrollTop());
        this.$overlay.css('height', $body.height());
    }, 
    
    _get_select_value: function(selector){
        // selectbox does some wonky stuff to the original <select> element. 
        var $options = $('option:selected', $(selector)), 
            values = $.map($options, function(el){ return $(el).attr('value'); });
        return Math.min.apply(null, values);
    }
});